import React from "react";
import ReactDOM from 'react-dom';


function Module(props)  {

  const modulRoot = document.getElementById("moduls");

  return ReactDOM.createPortal ((
    <div className="loginPage">
      <button className="loginPage__headerButton">{props.headerButton}</button>
      <form className="loginPage__form">
        <h2 className="loginPage__title">{props.name}</h2>
        <input className="loginPage__input" placeholder="Email"></input>
        <input className="loginPage__input" placeholder="Пароль"></input>
        <button className="loginPage__submitButton">{props.submitButton}</button>
      </form>
      {props.children}
    </div>,
    modalRoot
  ))
}

export default Module;
